import React from 'react';

import cards from '../utils/card-data.js';

import SelectableCard from './selectableCard.js';

const CardCollection = (props) => {

	const generateCollection = () => {		
		if (props.filter !== '') {
			return cards['items'].map(
				(c, i) => c.type === props.type ? <SelectableCard key={String(i) + '#card'} funcUtils={props.funcUtils} position={i} isBeingUsed={props.usedCardsList.includes(i)} isBanned={props.bannedCardsList.includes(i)} transparent={'labels' in c && c.labels.split(', ').includes(props.filter) ? false : true} /> : '' 
			);
		} else {
			return cards['items'].map((c, i) => c.type === props.type ? <SelectableCard position={i} funcUtils={props.funcUtils} isBeingUsed={props.usedCardsList.includes(i)} isBanned={props.bannedCardsList.includes(i)} /> : '' );
		}
	}

	return (
		<>				
			{ /* cards['items'].map((c, i) => c.type === props.type ? <SelectableCard position={i} /> : '' ) */ }
			{ props.visible ? generateCollection() : '' }			

		</>

	);
}


export default CardCollection;
